sys_variable_value.value:
(function execute(inputs, outputs) {
    // ... code ...
   
   if (inputs.status_code == '200') {
      let trains = [];
        var responseBody = JSON.parse(inputs.response_body);
        
        for (var i=0; i < responseBody.data.length; i++){
          let train = {
          "train_number": responseBody.data[i].train_number,
          "train_name": responseBody.data[i].train_name,
          "from_station_name": responseBody.data[i].from_station_name,
          "to_station_name": responseBody.data[i].to_station_name,
          "has_pantry" : responseBody.data[i].has_pantry
          }
          trains.push(train);
        }
        outputs.trains = trains;
   }
   

})(inputs, outputs);

